INSERT INTO diagrams VALUES(325,'Check_Payment_Amounts','2442 790',replace('NEXO: It is very strange, they use ad-hoc cardholder message that is not defined in Annex 14.1.\n\nAdditionally they define single message "Transaction Aborted: Supplementary ...", but I think it is more optimal to send two messages: "Aborted", "Supplementary...".\n\nIf it will be shown to be a problem it can be changed.\n\nNEXO: The flow is altered, nexo defines that if multipl conditions apply, then all messages should be displayed in order, but this gives posibility for a situation where attendant cancells first screen and then next screen will be displayed.\n\nNEXO: Also they messed up nokReason handling They repeatedly write, that "Cancelled", should be used if attendant decides to cancel Data Output, but then they blatantly set Nok Reason to "Amount Error"! Also they do not bother to explain how actually those addtional Nok Reasons should be handled.\n\nThis procedure has one of the worst descriptions in the specification.','\n',char(10)),100.0);
